sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var res_obj =  JSON.parse(inputs.response_body);
   gs.info(res_obj)
  var output_body = {concerts: []}
  for(var i = 0 ; i < res_obj.length; i++)
  {
    var obj = {}
    obj.name = res_obj[i].name;
    obj.venue = res_obj[i].venue;
    obj.date = res_obj[i].date;
    obj.dayOfWeek = res_obj[i].dayOfWeek;
    obj.image = res_obj[i].image;
    obj.link = res_obj[i].link;
    obj.time = res_obj[i].time;
    obj.id = i;
   	output_body.concerts.push(obj); 
  }
  outputs.concerts = output_body;
})(inputs, outputs);

